How to test if a document's property changed?<p>I'm writing tests for an Express CRUD app. The app has an account recovery route that accepts POST requests with an email in the body. It searches for an user with a given email, changes it's password then sends an email with the new password and returns 200. </p>

<p>So I want to write a test that checks if the user's password has indeed changed. </p>

<p>This was my attempt: </p>

<p>First I created a user factory using the <code>factory-girl</code> lib. </p>

<pre><code>// factory.js file

const { factory } = require('factory-girl');
const User = require('../../models/User');

factory.define('User', User, {
    email: factory.sequence('User.email', n =&gt; `fakeuser${n}@mail.com`),
    name: factory.chance('name'),
    password: factory.chance('word')
});

module.exports = factory; 
</code></pre>

<p>Nice. Then I wrote the test:</p>

<pre><code>// One test inside my test suite

it('should return 200 and change user\'s password', async () =&gt; {
        const user = await factory.create('User');
        const oldPassword = user.password; 

        const response = await request(app)
            .post(endpoint)
            .send({ email: user.email });

        const passwordChanged = oldPassword !== user.password; 

        expect(response.status).toBe(200);
        expect(passwordChanged).toBe(true);
        await user.remove();
});
</code></pre>

<p>But <code>passwordChanged</code> is always being evaluated to <code>false</code>, since <code>user.password</code> doesn't change at all. I mean, on the database, it changes (the method works correctly), but on my test the user object is not updated after the request. </p>

<p>In other words, what I want to test here is the state of a document in the database, not only what the request is returning. Any suggestions on how to achieve this?</p>

