How to get data as is from MongoDB and send it to an API as JSON in Golang<p>I am writing a Golang API at work which when called, gets data from two different MongoDB Collections and appends it into a struct, converts it to JSON, and stringified and sends to an API (Amazon SQS)</p>

<p>The problem is, defining the struct of the data receiving from MongoDB, while some of the fields are defined properly, some are varying</p>

<pre><code>// IncentiveRule struct defines the structure of Incentive rule from Mongo
type IncentiveRule struct {
    ... Other vars
    Rule               Rule               `bson:"rule" json:"rule"`
    ... Other vars
}

// Rule defines the struct for Rule Object inside an incentive rule
type Rule struct {
    ...
    Rules          interface{}    `bson:"rules" json:"rules"`
    RuleFilter     RuleFilter     `bson:"rule_filter" bson:"rule_filter"`
    ...
}

// RuleFilter ...
type RuleFilter struct {
    Condition string        `bson:"condition" json:"condition"`
    Rules     []interface{} `bson:"rules" json:"rules"`
}

</code></pre>

<p>While this works, the <code>interface{}</code> defined inside <code>Rule</code> struct is varying and while getting as BSON and decoding and re-encoding to JSON, instead of encoding as <code>"fookey":"barvalue"</code> in JSON, it is encoded as <code>"Key":"fookey","Value":"barvalue"</code>, how to avoid this behavior and have it as <code>"fookey":"barvalue"</code></p>

