            });
        });
    } else {
        Post.update(query, post, function(err) {
            if (err) {
                console.log(err);
                return;
            } else {
                req.flash('success', "The post was successfully updated");
                req.session.save(() =&gt; res.redirect('/dashboard'));
            }
        });
    }
}
</code></pre>

<p>What have I missed?</p>

